import React, { useState } from "react";
import SelectAccountForm from "components/AuthForm/SelectAccountForm";
import { StyleSheet, View } from "react-native";
import { Card, Button, IconButton } from "react-native-paper";

const RegisterForm = ({ setShowRegisterForm }) => {
  const [account, setAccount] = useState();
  return (
    <Card style={styles.registerContainer}>
      {!account && (
        <SelectAccountForm setShowRegisterForm={setShowRegisterForm} />
      )}
      {account === "Médecin" && <DoctorForm />}
      {account === "Établissement" && <EstablishmentForm />}
    </Card>
  );
};

const styles = StyleSheet.create({
  registerContainer: {
    width: "500px",
    marginLeft: "auto",
    marginRight: "auto",
    paddingTop: "80px",
    paddingBottom: "80px",
    borderColor: "#D3D3D3",
    borderWidth: "1px",
    borderRadius: "10px",
  },
});

export default RegisterForm;
